window.bookSummaryJSON = "<p>The event of myths and legends has started! The first spawn points have started to open, issuing forth creatures and people that were banished from Emerilia long ago.</p> <p>Dave and the Pandora’s Box group are advancing their plans and building projects as fast as possible. When an opportunity arises to take their projects to the next level, they’re going to have to use all of their tricks and crafting abilities in order to seize it.</p> <p>The Stone Raiders and the Terra Alliance that they have formed will undergo its first baptism. The time of peace has ended.</p> <p>In this event, they need to be the strongest to protect what they care for. Either they will die again and again losing levels and people of Emerilia, or they will be able to stand, their strength growing to new heights.</p>"; 
